import React from "react";
import { makeStyles, withStyles } from "@material-ui/core";
import { TextField, Typography, Button, Grid, Box } from "@material-ui/core";
import SendIcon from "@material-ui/icons/Send";
import Navbar from "./Navbar";
import { mergeClasses } from "@material-ui/styles";
const InputField = withStyles({
  root: {
    "& label.Mui-focused": {
      color: "red",
    },
    "& label": {
      color: "tan",
    },
    "& .MuiOutlinedInput-root": {
      "& fieldset": {
        borderColor: "tan",
      },
    },
    "& .MuiOutlinedInput-root:hover": {
      "& fieldset": {
        borderColor: "tan",
      },
    },

    "&.Mui-focused fieldset": {
      borderColor: "tan",
    },
  },
})(TextField);
const ContactMe = () => {
  return (
    <Box component="div">
      <Grid container justify="center">
        <Box component="form">
          <Typography variant="h5">hire or contact me...</Typography>

          <InputField
            fullWidth={true}
            label="Name"
            variant="outlined"
            margin="dense"
            inputProps={{ style: { color: "white" } }}
            size="medium"
          />
          <br />
          <InputField
            fullWidth={true}
            label="Email"
            variant="outlined"
            inputProps={{ style: { color: "white" } }}
            margin="dense"
          />
          <br />
          <InputField
            fullWidth={true}
            label="Message"
            variant="outlined"
            inputProps={{ style: { color: "white" } }}
            margin="dense"
          />
          <br />
          <Button
            variant="outlined"
            fullWidth={true}
            endIcon={<SendIcon />}
            className={mergeClasses.sendbutn}
          >
            Contact Me
          </Button>
        </Box>
      </Grid>
    </Box>
  );
};

export default ContactMe;
